INSERT [dbo].[DatabaseLog] ([DatabaseLogID], [PostTime], [DatabaseUser], [Event], [Schema], [Object], [TSQL], [XmlEvent]) VALUES (2, CAST(N'2025-08-25T02:04:16.803' AS DateTime), N'sqladmin', N'CREATE_PROCEDURE', N'dbo', N'uspGetAuthorManagers', N'            
CREATE PROCEDURE [dbo].[uspGetAuthorManagers]
    @BusinessEntityID [int]
AS
BEGIN
    SET NOCOUNT ON;
    WITH [EMP_cte]([BusinessEntityID], [OrganizationNode], [FirstName], [LastName], [JobTitle], [RecursionLevel]) 
    AS (
        SELECT e.[BusinessEntityID], e.[OrganizationNode], p.[FirstName], p.[LastName], e.[JobTitle], 0 
        FROM [dbo].[Author] e 
            INNER JOIN [dbo].[Person] as p
            ON p.[BusinessEntityID] = e.[BusinessEntityID]
        WHERE e.[BusinessEntityID] = @BusinessEntityID
        UNION ALL
        SELECT e.[BusinessEntityID], e.[OrganizationNode], p.[FirstName], p.[LastName], e.[JobTitle], [RecursionLevel] + 1 
        FROM [dbo].[Author] e 
            INNER JOIN [EMP_cte]
            ON LEFT(e.[OrganizationNode], LEN(e.[OrganizationNode]) - 1) = [EMP_cte].[OrganizationNode]
            INNER JOIN [dbo].[Person] p 
            ON p.[BusinessEntityID] = e.[BusinessEntityID]
    )
    SELECT [EMP_cte].[RecursionLevel], [EMP_cte].[BusinessEntityID], [EMP_cte].[FirstName], [EMP_cte].[LastName], 
        [EMP_cte].[OrganizationNode] AS [OrganizationNode], p.[FirstName] AS ''ManagerFirstName'', p.[LastName] AS ''ManagerLastName''  
    FROM [EMP_cte] 
        INNER JOIN [dbo].[Author] e 
        ON LEFT([EMP_cte].[OrganizationNode], LEN([EMP_cte].[OrganizationNode]) - 1) = e.[OrganizationNode]
        INNER JOIN [dbo].[Person] p 
        ON p.[BusinessEntityID] = e.[BusinessEntityID]
    ORDER BY [RecursionLevel], [EMP_cte].[OrganizationNode]
    OPTION (MAXRECURSION 25) 
END;
', N'<EVENT_INSTANCE><EventType>CREATE_PROCEDURE</EventType><PostTime>2025-08-25T02:04:16.803</PostTime><SPID>68</SPID><ServerName>EC2AMAZ-B8QKRL0</ServerName><LoginName>sqladmin</LoginName><UserName>sqladmin</UserName><DatabaseName>BobsUsedBookStore</DatabaseName><SchemaName>dbo</SchemaName><ObjectName>uspGetAuthorManagers</ObjectName><ObjectType>PROCEDURE</ObjectType><TSQLCommand><SetOptions ANSI_NULLS="ON" ANSI_NULL_DEFAULT="ON" ANSI_PADDING="ON" QUOTED_IDENTIFIER="ON" ENCRYPTED="FALSE" /><CommandText>            
CREATE PROCEDURE [dbo].[uspGetAuthorManagers]
    @BusinessEntityID [int]
AS
BEGIN
    SET NOCOUNT ON;
    WITH [EMP_cte]([BusinessEntityID], [OrganizationNode], [FirstName], [LastName], [JobTitle], [RecursionLevel]) 
    AS (
        SELECT e.[BusinessEntityID], e.[OrganizationNode], p.[FirstName], p.[LastName], e.[JobTitle], 0 
        FROM [dbo].[Author] e 
            INNER JOIN [dbo].[Person] as p
            ON p.[BusinessEntityID] = e.[BusinessEntityID]
