INSERT [dbo].[DatabaseLog] ([DatabaseLogID], [PostTime], [DatabaseUser], [Event], [Schema], [Object], [TSQL], [XmlEvent]) VALUES (26, CAST(N'2025-08-25T02:04:16.947' AS DateTime), N'sqladmin', N'CREATE_PROCEDURE', N'dbo', N'uspGetTopRegion', N'
-- Create procedures
CREATE PROCEDURE [dbo].[uspGetTopRegion]
    @Percent INT
AS
BEGIN
    WITH [HalfYearSales] AS (
        SELECT 
            psr.[RegionID],
            psr.[RegionName],
            COUNT(ps.[SaleID]) AS [NumberOfSales],
            SUM(ps.[TotalAmount]) AS [TotalSalesAmount],
            COUNT(DISTINCT ps.[CustomerID]) AS [NumberOfMembers]
        FROM 
            [dbo].[ProductSaleRegions] psr
        LEFT JOIN 
            [dbo].[ProductSales] ps ON psr.[RegionID] = ps.[RegionID]
        WHERE 
            ps.[SaleDate] >= DATEADD(MONTH, -6, GETDATE())
        GROUP BY 
            psr.[RegionID], psr.[RegionName]
    )
    SELECT * FROM (
        SELECT TOP 10 PERCENT * FROM [HalfYearSales] WHERE @Percent = 10 ORDER BY [NumberOfSales] DESC
        UNION ALL 
        SELECT TOP 20 PERCENT * FROM [HalfYearSales] WHERE @Percent = 20 ORDER BY [NumberOfSales] DESC
        UNION ALL 
        SELECT TOP 30 PERCENT * FROM [HalfYearSales] WHERE @Percent = 30 ORDER BY [NumberOfSales] DESC
        UNION ALL 
        SELECT TOP 40 PERCENT * FROM [HalfYearSales] WHERE @Percent = 40 ORDER BY [NumberOfSales] DESC
        UNION ALL 
        SELECT TOP 50 PERCENT * FROM [HalfYearSales] WHERE @Percent = 50 ORDER BY [NumberOfSales] DESC
    ) q
    ORDER BY [NumberOfSales] DESC, [TotalSalesAmount] DESC;
END;
', N'<EVENT_INSTANCE><EventType>CREATE_PROCEDURE</EventType><PostTime>2025-08-25T02:04:16.947</PostTime><SPID>68</SPID><ServerName>EC2AMAZ-B8QKRL0</ServerName><LoginName>sqladmin</LoginName><UserName>sqladmin</UserName><DatabaseName>BobsUsedBookStore</DatabaseName><SchemaName>dbo</SchemaName><ObjectName>uspGetTopRegion</ObjectName><ObjectType>PROCEDURE</ObjectType><TSQLCommand><SetOptions ANSI_NULLS="ON" ANSI_NULL_DEFAULT="ON" ANSI_PADDING="ON" QUOTED_IDENTIFIER="ON" ENCRYPTED="FALSE" /><CommandText>
-- Create procedures
CREATE PROCEDURE [dbo].[uspGetTopRegion]
    @Percent INT
AS
BEGIN
    WITH [HalfYearSales] AS (
        SELECT 
            psr.[RegionID],
            psr.[RegionName],
            COUNT(ps.[SaleID]) AS [NumberOfSales],
            SUM(ps.[TotalAmount]) AS [TotalSalesAmount],
            COUNT(DISTINCT ps.[CustomerID]) AS [NumberOfMembers]
        FROM 
            [dbo].[ProductSaleRegions] psr
        LEFT JOIN 
            [dbo].[ProductSales] ps ON psr.[RegionID] = ps.[RegionID]
        WHERE 
            ps.[SaleDate] &gt;= DATEADD(MONTH, -6, GETDATE())
        GROUP BY 
            psr.[RegionID], psr.[RegionName]
    )
    SELECT * FROM (
        SELECT TOP 10 PERCENT * FROM [HalfYearSales] WHERE @Percent = 10 ORDER BY [NumberOfSales] DESC
        UNION ALL 
        SELECT TOP 20 PERCENT * FROM [HalfYearSales] WHERE @Percent = 20 ORDER BY [NumberOfSales] DESC
        UNION ALL 
        SELECT TOP 30 PERCENT * FROM [HalfYearSales] WHERE @Percent = 30 ORDER BY [NumberOfSales] DESC
        UNION ALL 
        SELECT TOP 40 PERCENT * FROM [HalfYearSales] WHERE @Percent = 40 ORDER BY [NumberOfSales] DESC
        UNION ALL 
        SELECT TOP 50 PERCENT * FROM [HalfYearSales] WHERE @Percent = 50 ORDER BY [NumberOfSales] DESC
    ) q
    ORDER BY [NumberOfSales] DESC, [TotalSalesAmount] DESC;
END;
</CommandText></TSQLCommand></EVENT_INSTANCE>')
INSERT [dbo].[DatabaseLog] ([DatabaseLogID], [PostTime], [DatabaseUser], [Event], [Schema], [Object], [TSQL], [XmlEvent]) VALUES (27, CAST(N'2025-08-25T02:04:16.953' AS DateTime), N'sqladmin', N'CREATE_PROCEDURE', N'dbo', N'uspDeleteOldCoupons', N'
CREATE OR ALTER PROCEDURE [dbo].[uspDeleteOldCoupons]
    @DaysOld INT
AS
BEGIN
    DECLARE @DeletedCount INT = 0;
    
    SELECT [TicketID], [CreatedDate]
    INTO #CouponsToDelete
    FROM [dbo].[Coupons]
    WHERE TRIM([Status]) = ''Closed'' AND [ResolvedDate] <= DATEADD(DAY, -@DaysOld, GETDATE());

    DECLARE @CouponsCount INT;
    SELECT @CouponsCount = COUNT(*) FROM #CouponsToDelete;

    IF @CouponsCount > 0
    BEGIN
        DELETE t
        FROM [dbo].[Coupons] t
        INNER JOIN #CouponsToDelete d ON t.[TicketID] = d.[TicketID];
        
        SET @DeletedCount = @@ROWCOUNT;
        PRINT ''Deleted '' + CAST(@DeletedCount AS NVARCHAR(10)) + '' coupons.'';
    END
    ELSE
    BEGIN
        PRINT ''No coupons found matching the criteria.'';
    END
END;
