INSERT [dbo].[DatabaseLog] ([DatabaseLogID], [PostTime], [DatabaseUser], [Event], [Schema], [Object], [TSQL], [XmlEvent]) VALUES (29, CAST(N'2025-08-25T02:04:16.963' AS DateTime), N'sqladmin', N'CREATE_PROCEDURE', N'dbo', N'uspShoppingLevelAmount', N'
CREATE OR ALTER PROCEDURE [dbo].[uspShoppingLevelAmount]
    @Percent INT,
    @Amount NUMERIC
AS
BEGIN
    SELECT 
        [OrderID],
        ''|'' + CASE 
                WHEN @Percent > 100 THEN
                    CASE 
                        WHEN [TotalAmount] > @Amount THEN ''more than''
                        ELSE ''less than''
                    END
              END + ''|'' AS [AmountLevel]
    FROM [dbo].[Shopping];
END;
', N'<EVENT_INSTANCE><EventType>CREATE_PROCEDURE</EventType><PostTime>2025-08-25T02:04:16.963</PostTime><SPID>68</SPID><ServerName>EC2AMAZ-B8QKRL0</ServerName><LoginName>sqladmin</LoginName><UserName>sqladmin</UserName><DatabaseName>BobsUsedBookStore</DatabaseName><SchemaName>dbo</SchemaName><ObjectName>uspShoppingLevelAmount</ObjectName><ObjectType>PROCEDURE</ObjectType><TSQLCommand><SetOptions ANSI_NULLS="ON" ANSI_NULL_DEFAULT="ON" ANSI_PADDING="ON" QUOTED_IDENTIFIER="ON" ENCRYPTED="FALSE" /><CommandText>
CREATE OR ALTER PROCEDURE [dbo].[uspShoppingLevelAmount]
    @Percent INT,
    @Amount NUMERIC
AS
BEGIN
    SELECT 
        [OrderID],
        ''|'' + CASE 
                WHEN @Percent &gt; 100 THEN
                    CASE 
                        WHEN [TotalAmount] &gt; @Amount THEN ''more than''
                        ELSE ''less than''
                    END
              END + ''|'' AS [AmountLevel]
    FROM [dbo].[Shopping];
END;
</CommandText></TSQLCommand></EVENT_INSTANCE>')
INSERT [dbo].[DatabaseLog] ([DatabaseLogID], [PostTime], [DatabaseUser], [Event], [Schema], [Object], [TSQL], [XmlEvent]) VALUES (30, CAST(N'2025-08-25T02:04:16.970' AS DateTime), N'sqladmin', N'CREATE_FUNCTION', N'dbo', N'ufnCalculateCustomerLifetimeValue', N'
CREATE OR ALTER FUNCTION [dbo].[ufnCalculateCustomerLifetimeValue]
(
    @CustomerID INT
)
RETURNS DECIMAL(10, 2)
AS
BEGIN
    DECLARE @TotalSpent DECIMAL(10, 2);
    DECLARE @FirstOrderDate DATE;
    DECLARE @DaysSinceFirstOrder INT;
    DECLARE @LifetimeValue DECIMAL(10, 2);
    
    SELECT 
        @TotalSpent = SUM([TotalAmount]),
        @FirstOrderDate = MIN([OrderDate])
    FROM [dbo].[Shopping]
    WHERE [CustomerID] = @CustomerID AND TRIM([Status]) != ''Refund Requested'';
    
    SET @DaysSinceFirstOrder = DATEDIFF(DAY, @FirstOrderDate, GETDATE());
    
    IF @DaysSinceFirstOrder = 0
        SET @LifetimeValue = @TotalSpent;
    ELSE
        SET @LifetimeValue = (@TotalSpent / @DaysSinceFirstOrder) * 365.25;
    
    RETURN @LifetimeValue;
END;
', N'<EVENT_INSTANCE><EventType>CREATE_FUNCTION</EventType><PostTime>2025-08-25T02:04:16.970</PostTime><SPID>68</SPID><ServerName>EC2AMAZ-B8QKRL0</ServerName><LoginName>sqladmin</LoginName><UserName>sqladmin</UserName><DatabaseName>BobsUsedBookStore</DatabaseName><SchemaName>dbo</SchemaName><ObjectName>ufnCalculateCustomerLifetimeValue</ObjectName><ObjectType>FUNCTION</ObjectType><TSQLCommand><SetOptions ANSI_NULLS="ON" ANSI_NULL_DEFAULT="ON" ANSI_PADDING="ON" QUOTED_IDENTIFIER="ON" ENCRYPTED="FALSE" /><CommandText>
CREATE OR ALTER FUNCTION [dbo].[ufnCalculateCustomerLifetimeValue]
(
    @CustomerID INT
)
RETURNS DECIMAL(10, 2)
AS
BEGIN
    DECLARE @TotalSpent DECIMAL(10, 2);
    DECLARE @FirstOrderDate DATE;
    DECLARE @DaysSinceFirstOrder INT;
    DECLARE @LifetimeValue DECIMAL(10, 2);
    
    SELECT 
        @TotalSpent = SUM([TotalAmount]),
        @FirstOrderDate = MIN([OrderDate])
    FROM [dbo].[Shopping]
    WHERE [CustomerID] = @CustomerID AND TRIM([Status]) != ''Refund Requested'';
    
    SET @DaysSinceFirstOrder = DATEDIFF(DAY, @FirstOrderDate, GETDATE());
    
    IF @DaysSinceFirstOrder = 0
        SET @LifetimeValue = @TotalSpent;
    ELSE
        SET @LifetimeValue = (@TotalSpent / @DaysSinceFirstOrder) * 365.25;
    
    RETURN @LifetimeValue;
END;
</CommandText></TSQLCommand></EVENT_INSTANCE>')
